import PerfectScrollbar from 'react-perfect-scrollbar';
import {
    Box,
    Button,
    Card,
    CardHeader,
    Table,
    TableBody,
    TableCell,
    TableHead,
    TableRow,
    TableSortLabel,
    Tooltip,
    Paper,
    Grid,

} from '@mui/material';
import ArrowRightIcon from '@mui/icons-material/ArrowRight';
import SeverityPill from '../components/severity-pill';
import { makeStyles } from "@mui/styles";
import { UseForm, Form } from "../components/UseForm";
import Controls from "../components/controls/Controls";
import Avatar from '@mui/material/Avatar';
import Select from '@mui/material/Select';
import FormControl from '@mui/material/FormControl';
import React, { useState, useEffect  } from 'react'
import axios from "axios";
import InputLabel from "@mui/material/InputLabel";
import MenuItem from "@mui/material/MenuItem";
import AdapterDateFns from "@mui/lab/AdapterDateFns";
import Stack from "@mui/material/Stack";
import DesktopDatePicker from "@mui/lab/DesktopDatePicker";
import DateTimePicker from '@mui/lab/DateTimePicker';
import TextField from "@mui/material/TextField";
import LocalizationProvider from "@mui/lab/LocalizationProvider";
import DatePicker from '@mui/lab/DatePicker';
import TimePicker from "@mui/lab/TimePicker";

const useStyles = makeStyles({
    pageContent: {
        margin: "40px",
        padding: "24px",
    },

});

const baseURL = "http://localhost:8080/apiv1/parkingLot/get";

const initialFieldValues = {
    parkingLotId: 0,
    parkingRegNo: "",
    parkingLotLocation: "",
    parkingLotName: "",
    totalParkingSpaces: 0,

};


export default function ParkingLot(props) {
    const [parkDetail, setParkDetail] = useState(initialFieldValues);
    const [selected, setSelected] = React.useState("");
    const [value, setValue] = React.useState(new Date());
    const [parkLot, setParkLot] = React.useState([]);
    const [search, setSearch] = React.useState("");


    const handleInputChange = e =>{

        const {name, value} = e.target
        setParkDetail({
            ...parkDetail,
            [name]: value,
        })

    }



    const handleSubmit = e =>{
        e.preventDefault()



        axios.post("http://localhost:8080/apiv1/parkingLot/save", parkDetail)
            .then(response => {
                console.log(response)
            })
            .catch(error => {
                console.log(error)
            })

    }




    const classes = useStyles();

    return (
        <>
            <Box
                sx={{
                    display: 'flex',
                    flexWrap: 'wrap',
                    '& > :not(style)': {
                        m: 1,
                        width: '100%',
                        height: 350,
                    },
                }}
            >
                <Paper elevation={3} className={classes.pageContent}>
                    <Avatar /> {/*name*/}
                    <Form onSubmit={handleSubmit}>
                        <Grid container>
                            <Grid item xs={6}>
                                <Controls.Input
                                    variant="outlined"
                                    label="Parking LotReg"
                                    name="parkingRegNo"
                                    value={parkDetail.parkingRegNo}
                                    onChange={handleInputChange}
                                />

                                <Controls.Input
                                    variant="outlined"
                                    label="Parking Location"
                                    name="parkingLotLocation"
                                    value={parkDetail.parkingLotLocation}
                                    onChange={handleInputChange}
                                />

                                <Controls.Input
                                    variant="outlined"
                                    label="Parking Lot name"
                                    name="parkingLotName"
                                    value={parkDetail.parkingLotName}
                                    onChange={handleInputChange}
                                />

                                <Controls.Input
                                    variant="outlined"
                                    label="Parking Lot spaces"
                                    name="totalParkingSpaces"
                                    value={parkDetail.totalParkingSpaces}
                                    onChange={handleInputChange}
                                />


                            </Grid>

                        </Grid>
                        <Button variant="contained"
                                fullWidth
                                onClick={handleSubmit}
                        >Submit</Button>
                    </Form>
                </Paper>
            </Box>
        </>
    )
}
